import React, { Component } from 'react';
import './App.css';
import ReactCSSTransitionReplace from 'react-css-transition-replace';

class HeaderStatus extends Component {
  constructor(props) {
    super(props);

    this.state = {
      statusBad: false,
      statusGood: false
    }
  }

  render() {
    const { statusBad, statusGood } = this.state;

    if (!statusGood && !statusBad)
      return <div></div>;
    else if (statusGood)
      return (
        <ReactCSSTransitionReplace
          transitionName="cross-fade"
          transitionEnterTimeout={1000}
          transitionLeaveTimeout={1000}
        >
          <div key="transitioning-component-1" className="status-good">Successful</div>
        </ReactCSSTransitionReplace>
      );
    else if (statusBad)
      return (
        <ReactCSSTransitionReplace
          transitionName="cross-fade"
          transitionEnterTimeout={1000}
          transitionLeaveTimeout={1000}
        >
          <div key="transitioning-component-1" className="status-bad">Duplicate, nothing added</div>
        </ReactCSSTransitionReplace>
      );
  }
}

export default HeaderStatus;
